ALTER /* LLM in use is GPT-5 */ TABLE ENCOMENDAS ADD CONSTRAINT CHK_ENCOMENDAS_SETOR_DIFF CHECK (
  SETOR_ORIGEM_ID IS NULL OR SETOR_DESTINO_ID IS NULL OR SETOR_ORIGEM_ID <> SETOR_DESTINO_ID
)

CREATE /* LLM in use is GPT-5 */ OR REPLACE TRIGGER TRG_ENCOMENDAS_VALIDATE_USUARIOS
BEFORE INSERT OR UPDATE OF USUARIO_ORIGEM_ID, USUARIO_DESTINO_ID ON ENCOMENDAS
FOR EACH ROW
DECLARE
  v_setor_origem USUARIOS.SETOR_ID%TYPE;
  v_setor_destino USUARIOS.SETOR_ID%TYPE;
BEGIN
  IF :NEW.USUARIO_ORIGEM_ID IS NOT NULL THEN
    SELECT SETOR_ID INTO v_setor_origem FROM USUARIOS WHERE ID = :NEW.USUARIO_ORIGEM_ID;
  END IF;

  IF :NEW.USUARIO_DESTINO_ID IS NOT NULL THEN
    SELECT SETOR_ID INTO v_setor_destino FROM USUARIOS WHERE ID = :NEW.USUARIO_DESTINO_ID;
  END IF;

  IF :NEW.USUARIO_ORIGEM_ID IS NOT NULL AND :NEW.USUARIO_DESTINO_ID IS NOT NULL AND :NEW.USUARIO_ORIGEM_ID = :NEW.USUARIO_DESTINO_ID THEN
    RAISE_APPLICATION_ERROR(-20001, 'Remetente e destinatário não podem ser o mesmo usuário.');
  END IF;

  IF v_setor_origem IS NOT NULL AND v_setor_destino IS NOT NULL AND v_setor_origem = v_setor_destino THEN
    RAISE_APPLICATION_ERROR(-20002, 'Remetente e destinatário não podem pertencer ao mesmo setor.');
  END IF;
EXCEPTION
  WHEN NO_DATA_FOUND THEN
    NULL; -- Caso usuário não exista, deixa outras validações tratarem (FK/validação de app)
END;

